import {
  Navbar,
  Nav,
  NavItem
} from 'react-bootstrap';


function Header(){
  return(
    <Navbar>
      <Navbar>
        <Navbar>
          <a href="#">React-Bootstrap</a>
        </Navbar>
      </Navbar>
      <Nav class="collapse navbar-collapse navbar-1">
        <NavItem href="#">Link</NavItem>
      </Nav>
    </Navbar>
  )
}

export default Header;
